import React from "react";

export default function Summary(props) {

    const f = {fontFamily: "Patrick Hand"};
    return (<div className="w3-row">
        <h4 style={{...f, fontVariant: "small-caps"}}>Summary</h4>
        <p style={f}>{props.sum}</p>
    </div>)
};
